import React from 'react';
import PizzaLeft from '../pizzaLeft.jpg';

function Contact() {
  return (
    <div className='contact'>
    <div className='leftSide' style={{ backgroundImage:`url($)` }}></div>
    <div className='rightSide'></div>
    </div>
  )
}

export default Contact;
